import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

function BrownNavbar() {
  return (
    <Navbar bg="darkred" variant="dark">
      <Navbar.Brand style={{ color: 'gray' }}>My React Page</Navbar.Brand>
      <Nav className="mr-auto">
        <Nav.Link style={{ color: 'gray' }} href="#home">
          Home
        </Nav.Link>
        <Nav.Link style={{ color: 'gray' }} href="#about">
          About
        </Nav.Link>
        <Nav.Link style={{ color: 'gray' }} href="#contact">
          Contact
        </Nav.Link>
      </Nav>
    </Navbar>
  );
}

export default BrownNavbar;
